import "./Carousel.css";
import strawberryImage from "../../Assets/Images/fruit_strawberry.png";
import avocadoImage from "../../Assets/Images/fruit_avocado.png";
import orangeImage from "../../Assets/Images/fruit_orange.png";
import { useRef } from "react";

function Carousel(): JSX.Element {

let list = useRef

  return (
    <div className="Carousel">
      <div className="list" ref={list}>
        <div className="item strawberry active">
          <div className="content">strawberry</div>
          <img src={strawberryImage} className="fruit" />
        </div>
        <div className="item avocado">
          <div className="content">avocado</div>
          <img src={avocadoImage} className="fruit" />
        </div>
        <div className="item orange hidden">
          <div className="content">orange</div>
          <img src={orangeImage}  className="fruit" />
        </div>
      </div>
      <div className="leaves"></div>
      <div className="mockup"></div>
      <div className="shadow"></div>
      <div className="arrow">
        <button id="prev">&lt;</button>
        <button id="next">&gt;</button>
      </div>
    </div>
  );
}

export default Carousel;
